INSERT INTO `question_assistance` VALUES ('2', '1', 'F11-2', '服务助手在预约准备上需要做完整的信息设置，以保证客户顺利实现在线预约，本考核主要是检查：1、预约专员是否设置。2、预约时段是否做过调整。3、预约网点信息（地址坐标、门店照片、联系电话、营业时间）等的维护率', '预约设置完成率', '各个店在服务助手上对各个预约相关信息的设置完成情况。<br/>预约设置完成率=完成的各个设置项/要求设置的各个项数', '>100%', '>=75%', '<75%', '', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('3', '3', 'F3-1', '店内与客户完成预约后是否进行了确认', '预约确认率', '确认的预约单/全部预约单', '>80%', '>70%', '>60%', '<=60%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('4', '14', 'F9-1', '店内与客户完成预约后是否在15分钟内进行了确认', '预约按时确认率', '15分钟之内的确认单数/全部的预约单数', '>80%', '>70%', '>60%', '<=60%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('5', '7', 'F5-1', '店内是否在客户预约到店时间前2小时进行了提醒', '2小时提醒率', '提前2小时提醒的预约/所有预约单数', '>80%', '>70%', '>60%', '<=60%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('6', '7', 'F5-2', '店内的预约客户实际到店时间与预约时间的偏差', '预约客户偏差度', '(预约客户实际到店时间-预约客户预约到店时间）的绝对值', '<5分钟', '<15分钟', '<30分钟', '>=30分钟', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('7', '8', 'F5-3', '实际预约客户数目占比', '预约到店率', '预约到店客户数/到店客户数', '>50%', '>40%', '>30%', '<=30%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('8', '9', 'F6-1', '预约看板的实际使用情况', '预约看板使用率', '22天都有登录记录，日均时长使用8个小时', '是', '', '', '否', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('9', '15', 'F10-1', '预约客户享受优惠的占比情况', '优惠比率', '预约单中结算有优惠的/所有的预约结算单', '是', '', '', '否', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('10', '2', 'F2-1', '入店波峰分析', '入店车辆波动标准差', '店内8:00~18:00各个时段入场车辆数量波动幅度', '<1.0', '<1.5', '<2.5', '>=2.5', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('11', '10', 'F7-1', '预约类车辆下单时间与开工时间差（分钟）', '预约车辆及时开工点', '预约类车辆（开工时间-下单时间）', '<3分钟', '<5分钟', '<15分钟', '>=15分钟', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('12', '11', 'F7-2', '车辆在店的各个环节之间的高效流转', '高效流转率', '有效工时占比=有效工时/在店时长<br/>1） 平均有效工时=（完工时间-开工时间）/客户<br/>2)平均在店时长（结算时间-接车时间）/客户', '>80%', '>70%', '>60%', '<=60%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('13', '23', 'F20-1', '服务顾问给客户的预估交付时间是否准确', '预估偏差率', '预估偏差率=abs(预计完工时长/实际在店时长-1）<br/>1）预计完工时长为服务助手中预计的完工时长=预计完工时间-开单时间<br/>2）实际在店时长=（结算时间-开单时间）/客户', '<5%', '<10%', '<20%', '>=20%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_assistance` VALUES ('14', '36', 'F39-1', '车间是否进行质检', '质检比率', '店内完成质检车辆数/店内全部的结算交车数量', '>80%', '>70%', '>60%', '<=60%', '', '1', '2020-11-10 17:50:56', '1', '2020-11-10 17:50:56');
INSERT INTO `question_monitor` VALUES ('1', '5', 'P4-1', '经销店每月提供一次本店预约话术提升会议纪要', '1. 提报材料参照《预约话术提升会会议纪要模版》, 各项内容填写齐全', '1. 各项内容填报齐全，签到表人员签字清晰<br/>2. 会议发现问题具体，明确，有深度<br/>3. 会议提出2-3条提升建议，提升建议具备SMART原则，能够做到具体、可衡量，具有操作性，相关性强，有明确的时间要求<br/>4. 会议形成5条以上应对话术，话术实战性强，有很好的现场指导意义', '1. 各项内容填报齐全，签到表人员签字清晰<br/>2. 会议发现问题具体，明确，有深度<br/>3. 会议提出1-2条提升建议，提升建议具备SMART原则，能够做到具体、可衡量，具有操作性，相关性强，有明确的时间要求<br/>4. 会议形成2条以上应对话术，话术实战性强，有很好的现场指导意义', '1. 各项内容填报齐全，签到表人员签字清晰<br/>2. 会议发现问题具体，明确，有深度<br/>3. 会议提出1-2条提升建议<br/>4. 会议形成1条以上应对话术，话术实战性强，有很好的现场指导意义', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('2', '6', 'P4-2', '1）经销店提供店内过去一个月的所有抽查录音反馈表及抽查录音文件夹列表截图<br/>2）提供过去一个月中5个抽查录音反馈表及其录音文件', '1. 参考《预约录音抽查统计模板》和《预约录音抽查反馈表》， 各项内容填写齐全', '1. 店内录音抽查完成率在90%以上，且有对应的文件列表截图能够佐证<br/>2. 店内服务顾问人数、应该抽查录音数、实际抽查数符合实际情况<br/>3. 足量提供5份抽查录音，录音反馈内容分析详实，能够从录音中的热情度、专业度、邀约力度等三个角度进行展开反馈，指导性强', '1. 店内录音抽查完成率在80%以上，且有对应的文件列表截图能够佐证<br/>2. 店内服务顾问人数、应该抽查录音数、实际抽查数符合实际情况<br/>3. 提供3份及以上抽查录音，录音反馈内容分析详实，能够从录音中的热情度、专业度、邀约力度等三个角度进行展开反馈，指导性强', '1. 店内录音抽查完成率在70%以上，且有对应的文件列表截图能够佐证<br/>2. 店内服务顾问人数、应该抽查录音数、实际抽查数符合实际情况<br/>3. 提供2份及以上抽查录音，录音反馈内容分析详实，指导性强', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('3', '7', 'P5-1', '经销店提供过去一个月服务顾问与客户在微信、短信、菱菱邦APP上的预约到店提醒截图', '每个服务顾问提供4个，在不同的日期', '1. 店内确认短信完成率在90%以上，且有对应的文件列表截图能够佐证<br/>2. 店内服务顾问人数、应该抽查短信数、实际抽查短信数符合实际情况', '1. 店内确认短信完成率在80%以上，且有对应的文件列表截图能够佐证<br/>2. 店内服务顾问人数、应该抽查短信数、实际抽查短信数符合实际情况', '1. 店内确认短信完成率在70%以上，且有对应的文件列表截图能够佐证<br/>2. 店内服务顾问人数、应该抽查短信数、实际抽查短信数符合实际情况', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('4', '13', 'P9-1', '提供过去一个月晨会的10个小视频', '店内需要对每日晨会预约确认环节手机录制30秒小视频，记录现场情况，归档管理', '1. 视频提供10个以上，分别属于不同日期的晨会<br/>2. 视频内容显示晨会中在讨论本日预约客户情况<br/>3. 能够对本日到店预约客户做简短点评', '1. 视频提供7个以上，分别属于不同日期的晨会<br/>2. 视频内容显示晨会中在讨论本日预约客户情况<br/>3. 能够对本日到店预约客户做简短点评', '1. 视频提供5个以上 <br/>2. 视频内容显示晨会中在讨论本日预约客户情况', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('5', '10', 'P19-1', '提供过去一个月《常见问题和故障应对话术手册》', '1. 提报数量完成率<br/>2. 提报内容评价', '合格提报，内容丰富，有30条以上内容，与前期相比，有增加新内容', '合格提报，内容丰富，有20条以上内容，与前期相比，有增加新内容', '合格提报，内容丰富，有10条以上内容', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('6', '15', 'P19-2', '提供过去一个月围绕《常见问题和故障应对话术手册》的员工演练视频6段', '1. 提报数量完成率<br/>2. 提报内容评价', '1. 提报数量在6段以上，视频来自6个不同员工，6个不同日期<br/>2. 演练内容实战性强', '1. 提报数量在5段以上，视频来自5个不同员工<br/>2. 演练内容实战性强', '1. 提报数量在3段以上，视频来自3个不同员工，3个不同日期', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('7', '36', 'P39-1', '1. 提报三级质检照片5个<br/>2. 提供三级质检照片文件夹截屏', '按模版提报', '1. 三级质检照片达到5个以上 <br/>2. 照片清晰，能够清楚看到更换的变化', '1. 三级质检照片达到4个以上 <br/>2. 照片清晰，能够清楚看到更换的变化', '1. 三级质检照片达到3个以上 <br/>2. 照片清晰，能够清楚看到更换的变化', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('8', '37', 'P39-2', '提报维修质量提升研讨会议纪要', '按模版提报', '1. 会议纪要及时提报，总经理每次参加会议<br/>2. 会议讨论内容丰富，能够具体详细分析三级质检中存在的问题，提出可行的落地改进方案', '1. 会议纪要及时提报，售后总监每次参加会议<br/>2. 会议讨论内容丰富，能够具体详细分析三级质检中存在的问题，提出可行的落地改进方案', '1. 会议纪要及时提报 <br/>2. 会议讨论内容齐全，无缺项', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_monitor` VALUES ('9', '40', 'P49-1', '提供过去一个月的投诉专题会会议纪要', '按模版提报', '1. 会议纪要及时提报，总经理每次参加会议<br/>2. 会议讨论内容丰富，能够具体详细分析投诉中存在的问题，提出可行的落地改进方案', '1. 会议纪要及时提报，售后总监每次参加会议<br/>2. 会议讨论内容丰富，能够具体详细分析投诉中存在的问题，提出可行的落地改进方案', '1. 会议纪要及时提报 <br/>2. 会议讨论内容齐全，无缺项', '其他情况， 或未提报', '', '1', '2020-11-10 17:37:40', '1', '2020-11-10 17:37:40');
INSERT INTO `question_survey` VALUES ('1', '1', 'S1-1', '经销店联系您预约入店时是否能主动且准确地记得您上次保养的时间？<br/>A) 未提及<br/>B)未记得日期，询问我<br/>C) 提及且准确<br/>D)无印象<br/>E）无联系<br/>', '', '', '', '', '', '3', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('2', '1', 'S1-2', '在经销店联系您预约入店过程中，您是否感觉到对方对您的情况比较了解，比如在通话中提及了以下事项：<br/>A) 能够提及上次维修和检查时发现的车辆问题，提出本次的服务建议<br/>B）能够准确说出您的车辆的车龄和行驶里程，并提出针对性的保养和服务建议<br/>C）能够提及年检、续保、店内最新优惠等增值服务<br/>D）未提及以上内容', '', '', '', '', '', '4', '<', '20%', '40%', '70%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('3', '4', 'S4-1', '在经销店联系您预约入店过程中，您感觉对方的语气和态度如何？<br/>A) 一般正常语气沟通<br/>B) 冷冰冰，没什么情绪<br/>c) 热情、礼貌，非常周到<br/>d)没什么印象', '', '', '', '', '', '3', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('4', '7', 'S5-1', '在您预约进店前的前一天和前1-2个小时，经销店是否通过电话、微信、短信给您温馨提醒？<br/>A）没有印象<br/>B）是的<br/>C）没有<br/>', '', '', '', '', '', '2', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('5', '9', 'S6-1', '当您预约入店刚到到前台时，您是否注意到店内有标注您的预约信息的预约欢迎看板：<br/>A）没有印象<br/>B）是的<br/>C）没有', '', '', '', '', '', '2', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('6', '12', 'S8-1', '您在经销店有专属的服务顾问么？您每次都是她/他为您接待服务么？<br/>A）否<br/>B）是', '', '', '', '', '', '2', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('7', '12', 'S8-2', '在您购买新车的首次提车的时候，除了销售顾问，有没有专门的服务顾问参加交车并后期为您持续提供专属服务？<br/>A）是<br/>B）否', '', '', '', '', '', '1', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('8', '1', 'S10-1', '作为预约客户，经销店有没有提供给你特别的好处：<br/>A）有，时间更高效，优先维修，预约明显感觉到服务和维修都很快<br/>B）有，在工时或配件上有折扣<br/>C）有，其他形式的优惠<br/>D）没有印象，不知道有这样的优惠<br/>', '10', '7', '5', '0', '', '综合分', '>', '8.5', '7', '6', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('9', '16', 'S11-1', '在您在店等待期间，你是如何了解到你的车辆的维修进度的？<br/>A）我自己去车间查看<br/>B）服务顾问会每隔半个小时或一个小时给我通报更新一下<br/>C）我通过菱菱邦APP、经销店的液晶屏的进度看板去看进度的，比较准确<br/>D）没有什么很有效的方法让我了解我车辆的维修进度', '1', '0', '0', '1', '', '综合分', '<', '10%', '20%', '30%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('10', '18', 'S15-1', '在您到店维修时，接待您的服务顾问能否做到：<br/>A）热情微笑，主动迎前或站立问候接待您，而不是您先找他们才开始服务<br/>B）叫出您的姓名，根据您具体情况而给您更好的建议<br/>C）正常接待，没有太多好坏<br/>D）整体接待态度不好，体验不好', '0', '0', '1', '1', '', '综合分', '<', '10%', '20%', '30%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('11', '19', 'S17-1', '您进到售后前台，是否有人第一时间（30秒内）主动来接待您？而不是您与他们打招呼后才接待您<br/>A）是<br/>B）否<br/>', '', '', '', '', '', '1', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('12', '20', 'S18-1', '在服务顾问与您确定维修项目开始维修前， 有没有邀请您一起对您的车辆进行快捷全面的车辆检查？<br/>A）未有此环节<br/>B）有，只是简单看了一下<br/>C）有，还提醒我贵重物品要带走，标记了里程数和油箱量，挺贴心的<br/>D）有，检查前还用座椅套、方向盘套、脚垫，对车内、车外、后尾箱进行了检查，把引擎盖打开检查', '1', '1', '0', '0', '', '综合分', '<', '10%', '20%', '30%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('13', '21', 'S19-1', '你是如何评价服务顾问在帮你诊断车辆问题的专业能力的？<br/>A）服务顾问没让我感觉有多少专业能力，车辆问题主要是车间里的人更懂<br/>B）服务顾问在车辆检查中能够根据车辆问题进行专业分析，<br/>C）服务顾问讲的我也听不太懂，感觉似乎有道理但心里也没法判断，只能选择相信了<br/>', '', '', '', '', '', '2', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('14', '24', 'S21-1', '您觉得经销店维修的收费情况如何？<br/>A）收费很合理，服务顾问能够详细逐条解释每项收费标准，让我感觉物超所值<br/>B ) 收费还是可以接受的，服务顾问也做了详细解释<br/>C）收费是否合理没法做太准确判断，服务顾问解释也一概而过，我对价格感觉不是很踏实<br/>D）收费是挺贵的，服务顾问也没什么详细的解释<br/>', '10', '8', '7', '5', '', '综合分', '>', '8.5', '7', '6', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('15', '25', 'S22-1', '您是如何评价经销店的客休区服务的？<br/>A）有专职的客休区服务员，并能主动上前询问需要的饮料，服务热情<br/>B）客休区服务员没有主动接待客户，只是在吧台内接待客户<br/>C）没有看到专职的客休区服务员<br/><br/>', '10', '5', '0', '', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('16', '26', 'S24-1', '您如何评价维修后4S店给您的交车？<br/>A）没有特别的环节，服务顾问通知我车修好了， 结算后我就自行把车开走了<br/>B）服务顾问陪同我对车辆进行了简单的验收，把保养和维修的内容简单说了一遍。 <br/>C）服务顾问陪同我对车辆进行了详细验收，对维修保养成果进行了展示，包括换下来的新旧件和安装前后的比较。<br/>D）交车后还提供了额外的服务，有仪式感或小礼物（包括矿泉水等），服务顾问服务贴心周到。', '0', '5', '7', '10', '', '综合分', '>', '8.5', '7', '6', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('17', '26', 'S24-2', '您如何评价您车辆维修保养后经销店交给您时的状态：<br/>A ）车没洗或者洗的不干净，车内也有杂物或者摆放不整齐的<br/>B）车辆能够看得出来是经过整理清洁的，车洗得干净<br/>C）车内的空调、座椅、音响恢复原位<br/>', '0', '5', '10', '', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('18', '27', 'S26-1', '您如何评价4S店的结算和送行环节？<br/>A）比较简单，没什么特别的印象<br/>B）结束时服务顾问能够目送我们离开<br/>C）能够感受到比较优质的服务，结算时收银员能够起立微笑问候', '0', '5', '10', '', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('19', '28', 'S28-1', '在您维修后，接待过您的服务顾问有没有电话联系您关心维修后车辆的质量和效果情况？<br/>A）接待我的服务顾问联系过我，了解过我车辆维修后的质量和效果<br/>B）店里其他人联系过，了解对在店维修是否满意<br/>C）没有人联系过我<br/>', '10', '5', '0', '', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('20', '30', 'S29-1', '您对4S店的车辆现场管理印象如何？<br/>A） 车辆摆放感觉比较杂多随意，跟非专业品牌修理厂差不多<br/>B） 车辆停放管理专业，能够清晰便捷看到客户停车区、预检区和交车区等停车区域划分<br/>C）从接待大厅到车间以及车间内部通道整洁宽敞，无车辆杂乱停放<br/>D）车辆摆放整齐，所有车辆停放统一车头向外<br/><br/><br/>', '', '', '', '', '', '1', '<', '10%', '20%', '30%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('21', '31', 'S29-2', '您的车辆维修结束后是否在专门的交车区交付？<br/>A）没有感觉是专门的交车区，就在普通的过道或者车位上取的车<br/>B）有专门的交车区，地面或者旁边有“交车区”的标志<br/>C ) 有专门的交车区，交车区有特殊的标识，比如在室内专门位置，或者有交车背景墙<br/><br/>', '10', '5', '0', '', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('22', '32', 'S29-3', '您的4S店的现场整洁性印象如何？<br/>A）现场比较老旧，地面有破损裂纹，停车线掉色、磨损等现场比较多，尘土杂物摆放时有可见<br/>B）现场卫生和秩序保持较好，地面整洁无裂痕，停车线保持鲜亮，清晰，无损坏残缺迹象<br/><br/><br/>', '', '', '', '', '', '2', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('23', '33', 'S33-1', '您在4S店里客休区等待期间整体感觉如何？<br/>A）客休区环境设施较差<br/>B）客休区宽敞、明亮、整洁，有多种功能区的设置<br/>C）客休区有人性化的设计，例如多接口手机充电，共享充电台，香薰、背景音乐、电脑工作台、免洗洗手液等', '', '', '', '', '', '1', '<', '10%', '20%', '30%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('24', '34', 'S33-2', '您在客休区对车辆维修项目相关的布置感觉如何？<br/>A）没什么感觉， 客休区没有多少跟维修相关的布置<br/>B）有透明的玻璃窗可以看到车间的施工现场，或者有摄像头可以在电视屏幕上看到车间的现场施工<br/>C）能够看到店里有一些车辆使用和维修常识的介绍和宣传，例如常见保养项目介绍、原厂/非原厂件对比墙/柜、车主俱乐部活动、认证技师/服务顾问介绍等', '', '', '', '', '', '1', '<', '10%', '20%', '30%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('25', '35', 'S33-3', '您感觉店内对客休室的娱乐性方面投入如何？<br/>A）没有特别的发现<br/>B）有专门的娱乐区域，例如按摩区、台球区、茶艺区、儿童娱乐区、上网游戏区等', '', '', '', '', '', '2', '>', '80%', '60%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('26', '36', 'S39-1', '您对在经销店车辆维修的质量感觉如何？<br/>A）维修和保养做得很专业彻底，问题都能一次性解决<br/>B）维修和保养做得基本满意，还是有些问题没有彻底解决，或者很快就又出问题了<br/>C）维修和保养质量不是很可靠，经常会有修了问题还在，反复修理的问题<br/>D) 维修和保养质量非常不可靠，不值得信任', '', '', '', '', '', '1', '>', '85%', '70%', '40%', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('27', '39', 'S43-1', '对您和您的服务顾问的关系下面哪种描述是正确的？<br/>A）我有固定的服务顾问，每次去都是她/他接待我，我对她/他有非常好的信任感和熟悉度<br/>B）服务顾问在日常中能够主动给我一些车辆驾驶和保养的建议，对我提出的问题也能及时回复<br/>C）A和B都有<br/>D）没有固定的服务顾问', '7', '5', '10', '0', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
INSERT INTO `question_survey` VALUES ('28', '42', 'S47-1', '您如何评价经销店常规保养的效率如何？<br/>A）非常高效，基本能在1个小时内完成。 <br/>B）效率一般，稍微复杂一些情况就可能到1~2个小时，等待时间很长<br/>C）效率很低，很多简单的项目也要2个小时以上，稍微复杂时间更长', '10', '5', '0', '', '', '综合分', '>', '9', '7.5', '5', '', '', null, null, null, null);
